import React from 'react';
import ResponsiveNavBar from "../Partials/Header"
import SearchForm from '../utils/SearchForm';





function Home() {

  
  return (
    <div className="flex flex-col min-h-4xl overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex-grow  text-black font-sans">

      {/* home section */}
      <div class="relative bg-transparent   ">
        <div className='absolute right-0 bottom-6 max-w-4xl'>
          <img src='https://img.freepik.com/vecteurs-libre/concept-covoiturage-main-tenant-smartphone-application-pour-trouver-voiture_113065-246.jpg?w=996' alt="Background" className=''/>
        </div>
        <div class="relative max-w-4xl py-12 px-8 ml-4 sm:py-20 sm:px-8 lg:px-12">
          <div className='max-w-2xl mb-4'>
          <p class="font-black sm:text-6xl ">
          Travel <span className='text-teal-500  '>comfortably</span>, with <span className='text-teal-500 '>trusted</span> people,  and at the<span className='text-teal-500 '> lowest </span> price!
          </p>
          <p class="mt-10 text-xl leading-6 "><span className='text-teal-500 font-semibold'>+ 400,000</span>  members trust Us and carpool every day, everywhere in Morocco</p>
          </div >
          <div className=' pt-6 pb-12 mb-1 text-black'>
          <SearchForm />
          </div>
              
          </div>
        </div>
        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Home;
